import React from "react";

import { Props } from "./types";
import * as Styled from "./style";

const Header = ({}: Props) => {
  return (
    <Styled.MainHeader display={['none', 'none', 'flex']}>
      <RocketseatLogo />
      <Styled.Title fontSize={[30, 20, 10]} >Titulo da pagina</Styled.Title>
    </Styled.MainHeader>
  );
};

export default Header;
